import './App.css';
import {Header,Footer , Home , Orders} from './component/index';
import { BrowserRouter as Router , Routes , Route , Link  } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route path='/' element={<Home />}/>
          <Route path='/orders' element={<Orders />}/>
        </Routes>
        <Footer />
      </Router>
    </>
  );
}

export default App;
